import { Grid } from '@material-ui/core';
import React from 'react';
import useStyles from './styles';

const JobRight = ({ image, enterprise, started, finish, text }) => {

    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Grid container spacing={1}>
                <Grid item xs={6} sm={6} md={6} lg={6} xl={6} className={classes.contentImage} >
                    <img src={image} alt="" className={classes.imageSize} />
                </Grid>
                <Grid item xs={6} sm={6} md={6} lg={6} xl={6} className={classes.jobInformation}>
                    <h2 className={classes.titleEnterprise}>{enterprise}</h2>
                    <span className={classes.workTime}>
                        {started}
                        {finish !== null &&
                            <span> - {finish}</span>
                        }
                    </span>
                    <span>{text}</span>
                </Grid>
            </Grid>
        </div>
    );
}

export default JobRight;
